import React from "react";
import {Link} from "react-router-dom";

export default function Home() {
    return (
        <div className="home">

       <button className="rates"><Link style={{textDecoration:'none'}} to="/rates">Rates Page</Link></button>
       <button className="search"> <Link style={{textDecoration:'none'}} to="/search">Search Page</Link></button>
        </div>
    )

}
